import React, { Component } from "react";
import "./LoginPage.css";

import { connect } from 'react-redux';

class LoginPage extends React.Component {  
    constructor ( props ) {
        super ( props );
    }
    render() {
        return (
            <div className = "LoginPageForm">        
                <form action="">
                    <h1>ДУА "Гімназія №1 г.Ашмяны"</h1>
                    <div>
                        <input 
                            type="text" 
                            placeholder="Ваш логін" 
                            required="" 
                            id="username" />
                    </div>
                    <div>
                        <input 
                            type="password" 
                            placeholder="Ваш пароль" 
                            required="" 
                            id="password" />
                    </div>
                    <div>
                        <input 
                            type="submit" 
                            value="Log in" />                          
                    </div>
                </form>          
            </div>         
        )
    }
}
<div>
    
</div>
let storeToProps = ( store ) => {
    return {
        id : store.id
    }
}

export default connect(storeToProps) (LoginPage);
